      <div>
        <label htmlFor="email">Correo electrónico</label>
        <input type="email" id="email" />
        <label htmlFor="password">Contraseña</label>
        <input type="password" id="password" />
        <button>Iniciar Sesión</button>
      </div>
    </div>
  );
};
